'''HTC娘'''是电子产品厂家'''宏达国际(HTC)'''及其手机品牌'''HTC'''的拟人化萌娘。

== 简介 ==
生日：1997年5月15日

口号：Here's To Change（新），Quietly Brilliant（旧）、{{黑幕|Help This Company}}、{{黑幕|Hentai Tech Company(大霧)}}

别号来历是源于拼音输入法“HTC”打出“火腿肠”。

HTC娘曾在2008年与[[google娘]]合作，推出第一款[[Android娘|Android]]系统的智能手机娘HTC G1，自此之后与Google娘的关系似乎不错。HTC娘代工的google亲生子包括第一台Nexus手机HTC Nexus One, [[平板电脑娘|平板姬]]HTC Nexus 9,以及后Nexus时代的第一台Pixel手机Google pixel/pixel XL，Google pixel 2。2017年9月21日将手机部门卖给了[[Google娘]]。
近年在手机界發展卡関,雪紅姨望以VR拯救劣勢

